import React, { useState, useEffect } from 'react';
import axios from 'axios'; // Import Axios library
import { useNavigate } from 'react-router-dom';

import './TotalInfo.css';

function TotalInfo() {
  const navigate = useNavigate();

  const [FullNamePrefix, setFullNamePrefix] = useState('');
  const [FullName, setFullName] = useState('');
  const [PanCard, setPanCard] = useState('');
  const [DateofBirth, setDateofBirth] = useState('');
  const [FlatNo, setFlatNo] = useState('');
  const [AreaStreet, setAreaStreet] = useState('');
  const [FlatNo1, setFlatNo1] = useState('');
  const [AreaStreet1, setAreaStreet1] = useState('');
  const [pincode, setPincode] = useState('');
  const [pincodee, setPincodee] = useState('');
  const [IsCurrentAddress, setIsCurrentAddress] = useState('');
  const [errorMessages, setErrorMessages] = useState({
    FullName: '',
    PanCard: '',
    DateofBirth: '',
    FlatNo: '',
    AreaStreet: '',
    CurrentAddress: '',
    pincode: '',
    pincodee: '',
    AreaStreet1: '',
  });

  useEffect(() => {
    // Retrieve form data from sessionStorage on component mount
    const formData = JSON.parse(sessionStorage.getItem('totalInfoFormData'));
    if (formData) {
      setFullNamePrefix(formData.FullNamePrefix);
      setFullName(formData.FullName);
      setPanCard(formData.PanCard);
      setDateofBirth(formData.DateofBirth);
      setFlatNo(formData.FlatNo);
      setAreaStreet(formData.AreaStreet);
      setFlatNo1(formData.FlatNo1);
      setAreaStreet1(formData.AreaStreet1);
      setPincode(formData.pincode);
      setPincodee(formData.pincodee);
      setIsCurrentAddress(formData.IsCurrentAddress);
    }
  }, []);

  const validateField = (fieldName, value, regex, errorMessage) => {
    if (!regex.test(value)) {
      setErrorMessages((prevErrors) => ({
        ...prevErrors,
        [fieldName]: errorMessage,
      }));
      return false;
    } else {
      setErrorMessages((prevErrors) => ({ ...prevErrors, [fieldName]: '' }));
      return true;
    }
  };

  const validateInputs = () => {
    const alphanumericRegex = /^[A-Za-z0-9\s]+$/;
    const panCardRegex = /^[A-Z]{5}[0-9]{4}[A-Z]$/;
    const dateOfBirthRegex = /^\d{1,2}\/\d{1,2}\/\d{4}$/;
    const pincodeRegex = /^\d{6}$/;

    let isValid = true;

    isValid = isValid && validateField('FullName', FullName, alphanumericRegex, 'Please enter your full name.');
    isValid = isValid && validateField('PanCard', PanCard, panCardRegex, 'Please enter a valid PanCard.');
    isValid = isValid && validateField('DateofBirth', DateofBirth, dateOfBirthRegex, 'Please enter a valid date of birth.');
    isValid = isValid && validateField('pincode', pincode, pincodeRegex, 'Please enter a valid pincode.');
    isValid = isValid && validateField('FlatNo', FlatNo, alphanumericRegex, 'Please enter a valid flat number.');
    isValid = isValid && validateField('AreaStreet', AreaStreet, alphanumericRegex, 'Please enter a valid area or street.');

    if (IsCurrentAddress === 'no') {
      isValid = isValid && validateField('pincodee', pincodee, pincodeRegex, 'Please enter a valid pincode.');
      isValid = isValid && validateField('FlatNo1', FlatNo1, alphanumericRegex, 'Please enter a valid flat number.');
      isValid = isValid && validateField('AreaStreet1', AreaStreet1, alphanumericRegex, 'Please enter a valid area or street.');
    }

    return isValid;
  };

  const handleInputChange = (fieldName, value, regex, errorMessage) => {
    switch (fieldName) {
      case 'FullNamePrefix':
        setFullNamePrefix(value);
        break;
      case 'FullName':
        setFullName(value);
        validateField(fieldName, value, regex, errorMessage);
        break;
      case 'PanCard':
        setPanCard(value);
        validateField(fieldName, value, regex, errorMessage);
        break;
      case 'DateofBirth':
        setDateofBirth(value);
        validateField(fieldName, value, regex, errorMessage);
        break;
      case 'FlatNo':
        setFlatNo(value);
        validateField(fieldName, value, regex, errorMessage);
        break;
      case 'AreaStreet':
        setAreaStreet(value);
        validateField(fieldName, value, regex, errorMessage);
        break;
      case 'FlatNo1':
        setFlatNo1(value);
        validateField(fieldName, value, regex, errorMessage);
        break;
      case 'AreaStreet1':
        setAreaStreet1(value);
        validateField(fieldName, value, regex, errorMessage);
        break;
      case 'pincode':
        setPincode(value);
        validateField(fieldName, value, regex, errorMessage);
        break;
      case 'pincodee':
        setPincodee(value);
        validateField(fieldName, value, regex, errorMessage);
        break;
      case 'IsCurrentAddress':
        setIsCurrentAddress(value);
        break;
      default:
        break;
    }

    // Store updated input value in sessionStorage
    sessionStorage.setItem(
      'totalInfoFormData',
      JSON.stringify({
        FullNamePrefix,
        FullName,
        PanCard,
        DateofBirth,
        FlatNo,
        AreaStreet,
        FlatNo1,
        AreaStreet1,
        pincode,
        pincodee,
        IsCurrentAddress,
      })
    );
  };

  const handleProceed = () => {
    const isValid = validateInputs();

    if (isValid) {
      // Prepare data object to send to the backend API
      const data = {
        fullNamePrefix: FullNamePrefix,
        fullName: FullName,
        panCard: PanCard,
        dateofBirth: DateofBirth,
        flatNo: FlatNo,
        areaStreet: AreaStreet,
        flatNo1: FlatNo1,
        areaStreet1: AreaStreet1,
        pincode: pincode,
        pincodee: pincodee,
        isCurrentAddress: IsCurrentAddress,
      };

      // Send POST request to the backend API
      axios
        .post('http://localhost:9856/api/user-address/add', data)
        .then((response) => {
          console.log('Data sent successfully:', response.data);
          navigate('/payment');
        })
        .catch((error) => {
          console.error('Error while sending data:', error);
        });
    } else {
      console.log('Form submission failed. Please check the fields.');
    }
  };
  // JSX structure of the component
  return (
    <div className='org12'>
      <h2>Fill the details</h2>
      <div className='forDispFlex'>
        <div className='fortablecls'>
          <h3>User Details</h3>
          <table className='fortable container'>
            {/* User details rows */}
            <tr>
              <td className='tbfont'>FullName:</td>
              <td>
                <select
                  value={FullNamePrefix}
                  onChange={(e) => setFullNamePrefix(e.target.value)}
                >
                  <option>Mr.</option>
                  <option>Mrs.</option>
                  <option>Ms.</option>
                </select>
              </td>
              <td className='tbfont1'>
                {FullNamePrefix} {userData.FullName}
              </td>
            </tr>
            <tr>
              <td className='tbfont'>MobileNo</td>
              <td>:</td>
              <td className='tbfont1'>{userData.Mobile}</td>
            </tr>
            <tr>
              <td className='tbfont'>Email.Id</td>
              <td>:</td>
              <td className='tbfont1'>{userData.Email}</td>
            </tr>
          </table>
          <div>
            <h3>Premium Data</h3>
            <table className='fortable container'>
              {/* Premium data rows */}
              <tr>
                <th></th>
                <th></th>
                <th></th>
              </tr>
              <tr>
                <th className='tbfont'>PropertyValue</th>
                <th>: </th>
                <th className='tbfont1'>{propertyValue}</th>
              </tr>
              <tr>
                <th className='tbfont'>CarpetValue</th>
                <th>: </th>
                <th className='tbfont1'>{carpetArea}</th>
              </tr>
              <tr>
                <th className='tbfont'>BuildingAge</th>
                <th>:</th>
                <th className='tbfont1'>{buildingAge} years</th>
              </tr>
              <tr>
                <th className='tbfont'>Total</th>
                <th>:</th>
                <th className='tbfont1'>
                  <h6>{popupMessage}</h6>
                </th>
              </tr>
            </table>
          </div>
        </div>

        <div className='forinner11d'>
          <form className='forinner11 container'>
            <h3>Enter PanCard details</h3>

            {/* Input field for FullName */}
            <div className='form-group11 container'>
              <div>FullName:</div>
              <div className='form-group11Input container'>
                <input
                  type='text'
                  className=''
                  placeholder='Enter your full name'
                  value={FullName.toUpperCase()}
                  onChange={(e) => handleInputChange('FullName', e.target.value, /.+/, 'Please enter your full name.')}
                />
                <p className='error-message11' style={{ color: 'red', textAlign: 'center' }}>
                  {errorMessages.FullName}
                </p>
              </div>
            </div>

            {/* Input field for PanCard */}
            <div className='form-group11 container'>
              <div>PanCard:</div>
              <div className='form-group11Input container'>
                <input
                  type='text'
                  className=''
                  placeholder='ex: ABCDE1234F'
                  value={PanCard.toUpperCase()}
                  onChange={(e) =>
                    handleInputChange('PanCard', e.target.value, /^[A-Z]{5}[0-9]{4}[A-Z]$/, 'Please enter a valid PanCard.')
                  }
                />
                <p className='error-message11' style={{ color: 'red', textAlign: 'center' }}>{errorMessages.PanCard}</p>
              </div>
            </div>

            {/* Input field for DateofBirth */}
            <div className='form-group11 container'>
              <div>DateofBirth:</div>
              <div className='form-group11Input container'>
                <input
                  type='text'
                  className=''
                  placeholder='ex: dd/mm/yyyy'
                  value={DateofBirth}
                  onChange={(e) =>
                    handleInputChange('DateofBirth', e.target.value, /^\d{1,2}\/\d{1,2}\/\d{4}$/, 'Please enter a valid date of birth.')
                  }
                />
                <p className='error-message11' style={{ color: 'red', textAlign: 'center' }}>
                  {errorMessages.DateofBirth}
                </p>
              </div>
            </div>

            {/* Input field for pincode */}
            <div className='form-group11 container'>
              <div>Enter Pincode:</div>
              <div className='form-group11Input container'>
                <input
                  type='text'
                  className='form-control'
                  placeholder='ex : 515001'
                  value={pincode}
                  onChange={(e) => setPincode(e.target.value)}
                  maxLength={6}
                />
                <p className='error-message'>{errorMessages.pincode}</p>
              </div>
            </div>

            {/* Input field for FlatNo */}
            <div className='form-group11 container'>
              <div>FlatNo/House No:</div>
              <div className='form-group11Input container'>
                <input
                  type='text'
                  className=''
                  placeholder='ex: 123'
                  value={FlatNo}
                  onChange={(e) =>
                    handleInputChange('FlatNo', e.target.value, /^[A-Za-z0-9\s]+$/, 'Please enter a valid flat number.')
                  }
                />
                <p className='error-message11' style={{ color: 'red', textAlign: 'center' }}>
                  {errorMessages.FlatNo}
                </p>
              </div>
            </div>

            {/* Input field for AreaStreet */}
            <div className='form-group11 container'>
              <div>Area/Street:</div>
              <div className='form-group11Input container'>
                <input
                  type='text'
                  className=''
                  placeholder='ex: Main Street'
                  value={AreaStreet}
                  onChange={(e) =>
                    handleInputChange('AreaStreet', e.target.value, /^[A-Za-z0-9\s]+$/, 'Please enter a valid area or street.')
                  }
                />
                <p className='error-message11' style={{ color: 'red', textAlign: 'center' }}>
                  {errorMessages.AreaStreet}
                </p>
              </div>
            </div>

            {/* Input field for IsCurrentAddress */}
            <div className='form-group11 container'>
              <div>Is the address mentioned above your current address:</div>
              <div className='form-group11Input container'>
                <select onChange={(e) => setIsCurrentAddress(e.target.value)}>
                  <option value=''>Select</option>
                  <option value='yes'>Yes</option>
                  <option value='no'>No</option>
                </select>
              </div>
            </div>

            {/* Conditional rendering based on IsCurrentAddress */}
            {IsCurrentAddress === 'no' && (
              <div className='form-group11 container'>
                <hr />
                <div>Current Address:</div>
                <br />
                {/* Input field for pincodee */}
                <div className='form-group'>
                  <label>
                    Enter Pincode <span style={{ color: 'red' }}>*</span> :
                  </label>
                  <input
                    type='text'
                    className='form-control'
                    placeholder='ex: 515001'
                    value={pincodee}
                    onChange={(e) => handleInputChange('pincodee', e.target.value, /^\d{6}$/, 'Please enter a valid pincode.')}
                    maxLength={6}
                  />
                  <p className='error-message'>{errorMessages.pincodee}</p>
                </div>

                {/* Input field for FlatNo1 */}
                <div>
                  <label>
                    FlatNo/House No <span style={{ color: 'red' }}>*</span> :
                  </label>
                  <input
                    type='text'
                    className=''
                    placeholder='ex: 123'
                    value={FlatNo1}
                    onChange={(e) => handleInputChange('FlatNo1', e.target.value, /^[A-Za-z0-9\s]+$/, 'Please enter a valid flat number.')}
                  />
                  <p className='error-message11' style={{ color: 'red', textAlign: 'center' }}>
                    {errorMessages.FlatNo1}
                  </p>
                </div>

                {/* Input field for AreaStreet1 */}
                <div>
                  <label>
                    Area/Street <span style={{ color: 'red' }}>*</span> :
                  </label>
                  <input
                    type='text'
                    className=''
                    placeholder='ex: Main Street'
                    value={AreaStreet1}
                    onChange={(e) => handleInputChange('AreaStreet1', e.target.value, /^[A-Za-z0-9\s]+$/, 'Please enter a valid area or street.')}
                  />
                  <p className='error-message11' style={{ color: 'red', textAlign: 'center' }}>
                    {errorMessages.AreaStreet1}
                  </p>
                </div>
              </div>
            )}

            {/* Proceed button */}
            <button className='btn btn-success my-2 ' type='button' onClick={handleProceed}>
              Proceed
            </button>
          </form>
        </div>
        <div></div>
      </div>
    </div>
  );
}

export default TotalInfo;
